import React, { useState } from 'react';
import ShortenForm from './components/ShortenForm';
import ShortenedTable from './components/ShortenedTable';

function App() {
  const [shortenedUrls, setShortenedUrls] = useState([]);

  const addShortenedUrl = (shortenedUrl) => {
    setShortenedUrls([shortenedUrl, ...shortenedUrls]);
  };

  return (
      <div className="container">
        <ShortenForm addShortenedUrl={addShortenedUrl} />
        <ShortenedUrlsList shortenedUrls={shortenedUrls} />
      </div>
  );
}

export default App;
